for i=-9.75:0.25:10
    for j=-10:0.25:10
        if i<=j
            x_L =  i*ones(1,81);
            x_U =  j*ones(1,81);

            GLOBAL.MaxEval=200000;
            PriLev=1;

            Opt_Result= gclSolve('obj', [], x_L, x_U, [], [], [],...
                [], [], [], GLOBAL, PriLev);

            % show the output results
            GO = Opt_Result.x_k;
            candidates(counter,:) = Opt_Result.f_k;
            values(counter,:) = [i;j];
            counter = counter + 1;
            
            if counter == 47
                i=11;j=11;
            end
        end
    end
